in_source: |-
  (defun insert (item lst)
      (if (null lst)
          (list item)
          (if (< item (car lst))
              ((push item lst))
              (push (car lst) (insert item (cdr lst))))))
  
  (defun insertion-sort (lst)
      (if (null lst)
          0
          (insert (car lst) (insertion-sort (cdr lst)))))
  
  (let ((el (read))
      (lst ()))
      (loop while (!= el 0)
          do
             (setq lst (push el lst))
             (setq el (read)))
  
      (setq lst (insertion-sort lst))
  
      (loop while (not (null lst))
          do
              (print (car lst))
              (setq lst (cdr lst))))
